import React, { Component } from 'react';
import './App.css';
import Pricing from './Pricing.js';

class App extends Component {

  componentWillMount() {
    fetch('./data/data.json')
      .then((response) => response.json())
      .then((response)=> {
        this.setState({
          data:response
        })
      });
  }

  render() {
    return (
     <Pricing></Pricing>
    );
  }
}

export default App;
